import React from 'react'
import d from './../Dialogs.module.css';
import {type_message_info__AC, sendmessage_AC} from "../../../data/datas";


const Message = (props) => {
    return (
        <div className={d.messages}>
            <div>
                {props.message}
            </div>
        </div>


    )
}
export default Message;
